  true,\n\t\"url\": null,\n\t\"notes\": \"Collect and aggregate information from state
  level reporting entities that can be used to measure the progress of 9 1-1 authorities
  across the country in enhancing their existing operations and migrating to more
  advanced - Internet-Protocol-enabled emergency networks. The data will be maintained
  in a \"National 9-1-1 Profile Database.\" One of the objectives of the National
  9-1-1 Program is to develop, collect, and disseminate information concerning practices,
  procedures, and technology used in the implementation of E9 1 1 services and to
  support 9-1-1 Public Safety Answering Points (PSAPs) and related state and local
  public safety agencies for 9 1 1 deployment and operations. The National 9-1-1 profile
  database can be used to follow the progress of 9-1-1 authorities in enhancing their
  existing systems and implementing next-generation networks for more advanced systems.\",\n\t\"license_title\":
